    "2016-07-27T23:00:28.417326",nt"name": "series-of-aerial-images-over-bear-river-migratory-bird-refuge-acquired-on-november-7th-and",nt"isopen":
    false,nt"url": null,nt"notes": "This data set includes 22 georeferenced
    images, acquired on November 7th and 9th, 1965, over portions of Bear River Migratory
    Bird Refuge, in Box Elder County, Utah. The frames were downloaded from Earth Explorer
    (USGS) and georeferenced within ArcGIS. The image files are named by frame number
    and can be referenced in the attached map. These images are georeferenced versions
    of original black and white aerial photographs downloaded from Earth Explorer (USGS).
    The original photo was georeferenced against the Box Elder County 2014 NAIP images.
    There are 22 total frames in this collection covering all of the impounded areas
    of the refuge. The reference map can be used to identify locations of the images
    in relation to the refuge boundary. These images provide a valuable look back in
    time before the major flooding which occurred in the early 1980's which the Great
    Salt Lake covered nearly all of the refuge. Flooding conditions remained for 5-6
    years. These images (given their high resolution; resolution 0.66 meters) allow
    delineation of landscape features and habitats including original infrastructure
    including levees and roads, distribution of emergent vegetation, etc. Change over
    time estimates can be made from these images using current imagery for comparison.
    These images, and others from 1937, are being used by refuge staff to assist in
    understanding and visualizing the historical content of the lands within the refuge
    and how they have changed over the last 80 years. Pixel resolution of these images
    is 0.66 meters. These images should be used for resource-level interpretation only.",nt"license_title":
